// src/components/Projects.jsx
import "../styles/main.css";

const Projects = () => {
    const projects = [
      {
        name: "Find Your Spot",
        description: "Full-stack app that helps students discover study locations on campus./nBuilt a RESTful API with Django and developed a responsive React frontend.\nIntegrated real-time filters and user-authored reviews.",
        tools: "Django, React, SQL",
        link: "#"
      },
      {
        name: "Rate My Professor Analyzer",
        description: "Sentiment analysis on RMP data using DistilBERT.",
        tools: "Python, Pandas, PyTorch",
        link: "#"
      },
      {
        name: "Advisor AI",
        description: "AI chatbot to streamline academic advising.",
        tools: "React, Flask, OpenAI",
        link: "#"
      },
      {
        name: "BookWorm",
        description: "Adaptive news reading powered by web scraping + OpenAI.",
        tools: "Django, BS4, OpenAI",
        link: "#"
      }
    ];

    return (
      <section id="projects" className="section alt-bg">
        <h2>Projects</h2>
        <div className="projects-grid">
          {projects.map(({ name, description, tools }, idx) => (
            <div key={idx} className="project-card">
              <h3>{name}</h3>
              <p>{description}</p>
              <p><strong>Tools:</strong> {tools}</p>
            </div>
          ))}
        </div>
      </section>
    );
  };

  export default Projects;
